import {Link } from "react-router-dom"
interface WarningHeader{
    label:string,
     buttonText:string,
     to: string;

}
export function BottomWarning({label,buttonText,to}){
return <div className="pt-2 text-sm flex justify-center">
    <div>
       {label}
    </div>
    <Link className="text-sm pointer underline pl-1 cursor-pointer" to={to}>
    {buttonText}
    </Link>
</div>
}
